import React from 'react';

export const Collection = ({name,photo,year,description}) => {
    return (
        <div className='collection'>
            <h1>{name}</h1>
            <img src={photo} alt="photo"/>
            <h4>{year}</h4>
            <p>{description}</p>
        </div>
    )
}
